import{_ as e,o as t,c as o,O as i}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 67-1200 (Repealed effective October 1, 2021) Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/67-1200.md","filePath":"vacode/67-1200.md"}'),n={name:"vacode/67-1200.md"},a=i('<h1 id="§-67-1200-repealed-effective-october-1-2021-definitions" tabindex="-1">§ 67-1200 (Repealed effective October 1, 2021) Definitions. <a class="header-anchor" href="#§-67-1200-repealed-effective-october-1-2021-definitions" aria-label="Permalink to &quot;§ 67-1200 (Repealed effective October 1, 2021) Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires another meaning:</p><p>&quot;Authority&quot; means the Virginia Offshore Wind Development Authority created pursuant to this chapter.</p><p>&quot;Developer&quot; means any private developer of offshore wind energy projects.</p><p>&quot;Offshore wind energy project&quot; means a wind-powered electric energy facility, including tower, turbine, and associated equipment, located off the coast of the Commonwealth beyond the Commonwealth&#39;s three-mile jurisdictional limit, and includes interests in land, improvements, and ancillary facilities.</p><p>&quot;Transmission study&quot; means a study to determine the potential interconnection options to accommodate multiple offshore wind energy projects in the Hampton Roads region.</p><p>2010, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0507" target="_blank" rel="noreferrer">507</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0681" target="_blank" rel="noreferrer">681</a>.</p>',7),r=[a];function s(c,d,l,p,f,h){return t(),o("div",null,r)}const _=e(n,[["render",s]]);export{m as __pageData,_ as default};
